script: |
  super -f text -I q12810.spq | sort > q12810.out

inputs:
  - name: q12810.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE + col1 NOT IN ( - + col0 * - 65 + - + col1, col1, + 36 * - + col2 - - ( - 33 ) + 79, ( + - col0 ), + col2, col0 );
  - name: tab2

outputs:
  - name: q12810.out
    data: |
